import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="./src/snapcodelogo.png" alt="Snap Code" style={{ width: '100vw', height: 'auto' }} />
        <nav className="Navbar">
          <div className="leftNav">
            <a href="#features">Features</a>
            <a href="#pricing">Pricing</a>
          </div>
          <div className="login">Login</div>
          <div className="joinWaitlist">Join Waitlist</div>
        </nav>
      </header>
    </div>
  );
}

export default App;
